const Footer = () =>{
    return(
        <footer className="footer mt-auto py-3 bg-primary">
                <div className="col-md-12">
                    <div className="col-md-8">
                        <p className="text-light"><small><strong>AKA SYSTEM</strong></small></p>
                    </div>
                    <div className="col-md-4">
                        <p className="text-light">App desenvolvido por <a className="text-light"href="https://github.com/lucasrodrigues19" target="_blank" rel="noreferrer"></a></p>
                        <p> Evento promovido pela escola DevSuperior: <a className="text-light" href="https://instagram.com/lucas_pereira.20" target="_blank" rel="noreferrer"><i className="bi bi-instagram"></i></a></p>
                    </div>
                </div>
        </footer>
    );
}
export default Footer;
